import React, { useState } from "react";
import "../css/edit.css";

function Delete({ showDeletePopup, closeDeletePopup }) {
    
  return showDeletePopup ? (

<div>
<div className="button-colonne margin">
            <div className="container_btn_invite">
              <a  href="#" className="btn1">
                Confirmer
              </a>
            </div>
            <div className="container_btn_invite">
              <a onClick={closeDeletePopup} href="#" className="btn1">
                Cancel
              </a>
            </div>
          </div>
       

</div>
      

  
  ) : null;
}

export default Delete;
